import React,{ Component } from "react";

export default class Users extends Component{
    //pour declare les variables par :
    constructor(props){
        super(props)
        this.state = {
              users:[]  
        }
    }
    //http request 
    componentDidMount(){
    fetch('https://jsonplaceholder.typicode.com/users')
      .then(response => response.json())
      .then(resultat => console.log(this.setState({users:resultat})))
    }
render(){
    return(
        <div>
        {this.state.users.map((value,index)=>{
            return(
                <>
                   {value.name}
                    {value.phone}
                 {value.username}
                    <hr/>
                </>
            )
        })}
        </div>
    )
}
}
